I’ve been home for just over a day after spending the last 2 weeks in one of my favorite places. Alaska’s remote Aleutian chain. It also happens to be one of the more remote and challenging places to access. We decided to gamble this time and go late in the season. Most days hovered below freezing with winds gusting up to 50+ knots regularly. I felt prepared for the conditions mentally & physically but it still wrecked my body and my equipment massively. We walked away from the trip with an overwhelming near 30,000 images. 
I’ve found the hardest part of being in this place is leaving... and I don’t mean because it’s so beautiful but because the weather get so bad that being stuck there for 2+ weeks with limited food is a common problem. This place is notorious for grounded flights. Half our crew had to wait out the bad weather for 4 extra days and is just finally departing tonight. 
